import React from "react";
import { 
    MDBCard,
    MDBCardBody,
    MDBCardHeader,
    MDBCardImage,
    MDBCardFooter,
    MDBRipple,
    MDBRow,
    MDBCol
 } from "mdb-react-ui-kit";




export function ProfileCard(props) {

    const {cardPicUrl,countryName,id} = props

    const card = document.getElementById(id);

    card.addEventListener("dragstart", dragStart);


    function dragStart(event) {
        // Store the card's ID in the dataTransfer object
        event.dataTransfer.setData("text/plain", event.target.id);
      }

      function dragOver(event) {
        // Prevent default behavior to allow dropping
        event.preventDefault();
      }



    return(
        <MDBCard id={id} className="profileCard-card" draggable="true"
            alignment='center'>
            <MDBCardImage className="" src={cardPicUrl} position="top" fluid alt='...' />
            <MDBCardFooter>{countryName}</MDBCardFooter>
        </MDBCard>
    )

}
